import React from 'react'
import classes from './Messages.module.css'
import {NavLink} from 'react-router-dom'

const Messages = (props) => {
    return (
        <>
        <ul>
            <li>
                <NavLink href="">Anton</NavLink>
            </li>
        </ul>
        </>
    );
}

export default Messages
